import React from 'react';
import './Toprated.css';

// #region constants

// #endregion

// #region styled-components

// #endregion

// #region functions

// #endregion

// #region component
const propTypes = {};

const defaultProps = {};

/**
 * 
 */
const Toprated = () => {
    return <div>
        <img id="Toprated1" src="Top Rated Arenas.png" alt="imagetoprated" />
        <p className='newArenaHeader'>Newly Added Arenas</p>
    </div>;
}

Toprated.propTypes = propTypes;
Toprated.defaultProps = defaultProps;
// #endregion

export default Toprated;
